def transform(sequence):
    new_sequence = ""
    for i in range(len(sequence)):
        if sequence[i] == "0":
            new_sequence += "0"
        else:
            new_sequence += sequence[:i+1].replace("0", "0") + sequence[i+1:]
    return new_sequence

